(1, 'Prokat-K2', 'logo.png', 3520, '77-77-777', 'Прокат инструмента в Магнитогорске', 'Наша компания является признанным лидером по прокату инструмента в городе Магнитогорск.\n\nУ нас Вы всегда сможете взять в аренду любой нужный Вам инструмент и будете уверены, что он будет в исправном состоянии и выполнит свои функции на все 100%', '<p>Наша компания является признанным лидером по прокату инструмента в городе Магнитогорск.</p>\n<p>У нас Вы всегда сможете взять в аренду любой нужный Вам инструмент и будете уверены, что он будет в исправном состоянии и выполнит свои функции на все 100%.</p>\n<table style="width: 100%; margin-left: auto; margin-right: auto;" border="1px solid red">\n<tbody>\n<tr style="height: 13px;">\n<td style="height: 13px; width: 10.4348%;">&nbsp;</td>\n<td style="height: 13px; width: 10.4348%;">&nbsp;</td>\n<td style="height: 13px; width: 10.4348%;">&nbsp;</td>\n<td style="height: 13px; width: 43.4783%;">&nbsp;</td>\n<td style="height: 13px; width: 10.5435%;">&nbsp;</td>\n<td style="height: 13px; width: 10.5435%;">&nbsp;</td>\n</tr>\n<tr style="height: 13px;">\n<td style="height: 13px; width: 10.4348%;">&nbsp;</td>\n<td style="height: 13px; width: 10.4348%;">&nbsp;</td>\n<td style="height: 13px; width: 10.4348%;">&nbsp;</td>\n<td style="height: 13px; width: 43.4783%;">&nbsp;</td>\n<td style="height: 13px; width: 10.5435%;">&nbsp;</td>\n<td style="height: 13px; width: 10.5435%;">&nbsp;</td>\n</tr>\n<tr style="height: 13px;">\n<td style="height: 13px; width: 10.4348%;">&nbsp;</td>\n<td style="height: 13px; width: 10.4348%;">&nbsp;</td>\n<td style="height: 13px; width: 10.4348%;">&nbsp;</td>\n<td style="height: 13px; width: 43.4783%;">&nbsp;</td>\n<td style="height: 13px; width: 10.5435%;">&nbsp;</td>\n<td style="height: 13px; width: 10.5435%;">&nbsp;</td>\n</tr>\n<tr style="height: 13px;">\n<td style="height: 13px; width: 10.4348%;">&nbsp;</td>\n<td style="height: 13px; width: 10.4348%;">&nbsp;</td>\n<td style="height: 13px; width: 10.4348%;">&nbsp;</td>\n<td>&nbsp;asdf</td>\n<td style="height: 13px; width: 10.5435%;">&nbsp;</td>\n<td style="height: 13px; width: 10.5435%;">&nbsp;</td>\n</tr>\n<tr style="height: 13px;">\n<td style="height: 13px; width: 10.4348%;">&nbsp;</td>\n<td style="height: 13px; width: 10.4348%;">&nbsp;</td>\n<td style="height: 13px; width: 10.4348%;">&nbsp;</td>\n<td style="height: 13px; width: 43.4783%;">&nbsp;</td>\n<td style="height: 13px; width: 10.5435%;">&nbsp;</td>\n<td style="height: 13px; width: 10.5435%;">&nbsp;</td>\n</tr>\n<tr style="height: 13px;">\n<td style="height: 13px; width: 10.4348%;">&nbsp;</td>\n<td style="height: 13px; width: 10.4348%;">&nbsp;</td>\n<td style="height: 13px; width: 10.4348%;">&nbsp;</td>\n<td style="height: 13px; width: 43.4783%;">&nbsp;</td>\n<td style="height: 13px; width: 10.5435%;">&nbsp;</td>\n<td style="height: 13px; width: 10.5435%;">&nbsp;</td>\n</tr>\n<tr style="height: 13px;">\n<td style="height: 13px; width: 10.4348%;">&nbsp;</td>\n<td style="height: 13px; width: 10.4348%;">&nbsp;</td>\n<td style="height: 13px; width: 10.4348%;">&nbsp;</td>\n<td style="height: 13px; width: 43.4783%;">&nbsp;</td>\n<td style="height: 13px; width: 10.5435%;">&nbsp;</td>\n<td style="height: 13px; width: 10.5435%;">&nbsp;</td>\n</tr>\n</tbody>\n</table>\n<p>&nbsp;</p>\n<p>Наша компания является признанным лидером по прокату инструмента в городе Магнитогорск.</p>\n<p>У нас Вы всегда сможете взять в аренду любой нужный Вам инструмент и будете уверены, что он будет в исправном состоянии и выполнит свои функции на все 100%.</p>\n<p>&nbsp;</p>', '<p>Прокат инструмента осуществляется на следущих условиях.</p>\n<p>1. Залог в виде документа или денежной суммы в размере в зависимости от арендуемых позиций</p>\n<p>2. Инструмент выдается чистым, в полной комплектации и со всеми необходимыми принадлежностями. В таком же виде он и должен быть возвращен.</p>\n<p>3. Инструмент должен быть возвращен строго в срок, предусмотренный договором.</p>', 2015, 1, 1, '2016-09-24 04:44:45', '4276 8720 7677 2764 (Сбербанк)', 'prokatf@mail.ru', 'г. Магнитогорск, ул. Первая, дом 1 строение 12', '<p>жфдтоа</p>\n<p>фэваложфвда</p>\n<p>фдоаж</p>\n<p>фдтоа</p>\n<table style="width: 522px; margin-left: auto; margin-right: auto; height: 165px;" border="1" cellspacing="5" cellpadding="5"><caption>Тарифы</caption>\n<tbody>\n<tr style="height: 13px;">\n<td style="width: 77px; height: 13px;">&nbsp;</td>\n<td style="width: 118px; height: 13px;">&nbsp;nhb</td>\n<td style="width: 77px; height: 13px;">&nbsp;</td>\n<td style="width: 78px; height: 13px;">&nbsp;</td>\n<td style="width: 80px; height: 13px;">&nbsp;</td>\n</tr>\n<tr style="height: 13px;">\n<td style="width: 77px; height: 13px;">&nbsp;</td>\n<td style="width: 118px; height: 13px;">&nbsp;</td>\n<td style="width: 77px; height: 13px;">&nbsp;</td>\n<td style="width: 78px; height: 13px;">&nbsp;</td>\n<td style="width: 80px; height: 13px;">&nbsp;</td>\n</tr>\n<tr style="height: 13px;">\n<td style="width: 77px; height: 13px;">&nbsp;</td>\n<td style="width: 118px; height: 13px;">&nbsp;</td>\n<td style="width: 77px; height: 13px;">&nbsp;</td>\n<td style="width: 78px; height: 13px;">&nbsp;</td>\n<td style="width: 80px; height: 13px;">&nbsp;</td>\n</tr>\n<tr style="height: 13px;">\n<td style="width: 77px; height: 13px;">&nbsp;</td>\n<td style="width: 118px; height: 13px;">&nbsp;</td>\n<td style="width: 77px; height: 13px;">&nbsp;</td>\n<td style="width: 78px; height: 13px;">&nbsp;</td>\n<td style="width: 80px; height: 13px;">&nbsp;</td>\n</tr>\n<tr style="height: 13px;">\n<td style="width: 77px; height: 13px;">ыва</td>\n<td style="width: 118px; height: 13px;">ываыв</td>\n<td style="width: 77px; height: 13px;">ыва</td>\n<td style="width: 78px; height: 13px;">ыва</td>\n<td style="width: 80px; height: 13px;">ыва</td>\n</tr>\n</tbody>\n</table>\n<p>&nbsp;</p>\n<p>лывоафжывал</p>\n<p>фжывалоыжвд</p>', '2016-10-30 12:37:21');
